import React from "react";
import { Link } from "react-router-dom";
import "./Nav.css";

function Nav() {
    return (
        <nav>
            <p> Hi UserName </p>
            <Link to="/">Home</Link>
            <Link >Your Profile</Link>
            <Link >Logout</Link>
        </nav>
    );
}

export default Nav;
